import React from 'react'
import './index.css'

function TodoCounter ({ totalTodos, completedTodos }) {
  return (
    <h2 className='TodoCounter'>Has completado {completedTodos} de {totalTodos} TODOs</h2>
  )
}

export { TodoCounter }
